export const fetchCollaborators = () => {
  return (dispatch) => {
    dispatch({ type: 'LOADING_COLLABORATORS'})
    fetch('https://localhost:3000/collaborators')
    .then(response => response.json())
    .then(responseJSON =>
      dispatch({ 
        type: 'ADD_COLLABORATORS',
        collaborators: responseJSON
      })
    )
  }
}
